import { all, delay, fork, put, takeLatest, throttle, call } from 'redux-saga/effects';

import {
    CREATE_CHAT_REQUEST,
    CREATE_CHAT_SUCCESS,
    CREATE_CHAT_FAILURE,
} from '../reducers/chat';





export default function * chatSaga() {
    yield all([
        fork(watchCreateChat),
    ]);
}
